import React, { Component } from 'react';
import Navbar from './components/Navbar';
import News from './components/News';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Navbar />
          <Switch>
            <Route exact path="/" component={() => <News pageSize={5} country="in" category="general" />} />
            <Route path="/business" component={() => <News pageSize={5} country="in" category="business" />} />
            <Route path="/entertainment" component={() => <News pageSize={5} country="in" category="entertainment" />} />
            <Route path="/general" component={() => <News pageSize={5} country="in" category="general" />} />
            <Route path="/health" component={() => <News pageSize={5} country="in" category="health" />} />
            <Route path="/science" component={() => <News pageSize={5} country="in" category="science" />} />
            <Route path="/sports" component={() => <News pageSize={5} country="in" category="sports" />} />
            <Route path="/technology" component={() => <News pageSize={5} country="in" category="technology" />} />
          </Switch>
        </Router>
      </div>
    );
  }
}
